import './App.css'

function App() {
	// get api data from https://opentdb.com/api.php?

  function getData() {
    fetch('https://opentdb.com/api.php?amount=10&category=9&difficulty=easy&type=multiple')
      .then(res => res.json())
      .then(data => console.log(data))
  }





	return <div className='App'>HELLO WORLD</div>
}

export default App
